import "./App.css";
import React from "react";


function Guvi() {
  return (
    <div>
      <h1>Welcome to Guvi</h1>
      <img src="https://www.guvi.in/build/images/foot-guvi-logo.a4e6ed37ef51b4ab25d3123efba35271.png" alt="logo" />
    </div>
  )
}

function App() {

  return (
    <div className="container">
      <Guvi />
    </div>
  );
}

export default App;
